content:
It's one thing to platform someone who is an anti-Zionist based on some semi-rational arguments.

To provide one to someone who was willing to murder Jews is a slap in the face to every Jew &amp; everyone on campus.

@SFSU has made its school &amp; the world a less safe place for Jews.

